double acos2(double value)
{
    double result;
    if(value >= 1.0)
    {
	result = acos(min(1.0,value));
    }
    else if(value <= -1.0)
    {
	result = acos(max(-1.0,value));
    }
    else
    {
	result =acos(value);
    }
    return result;
}

double sqrt2(double value)
{
    double result;

    if(value < 0.0)
    {
	result = 0.0;
    }
    else
    {
	result = sqrt(value);
    }

    if(result < 1e-25) result = 1e-25;
    return result;
}

