int main(int argc, char **argv)
{
    feenableexcept(FE_INVALID | FE_DIVBYZERO | FE_OVERFLOW  | FE_UNDERFLOW);
    
    double t = PI;
    double xlow = -6.0;
    double xhigh = 6.0;
    double ylow = -6.0;
    double yhigh = 6.0;

    int xelem = 100;
    int yelem = 100;

    int xnode = xelem+1;
    int ynode = yelem+1;

    double deltax = (xhigh-xlow)/xelem;
    double deltay = (yhigh-ylow)/yelem;
    
    double **x, **y;

    allocator2(&x,xnode,ynode);
    allocator2(&y,xnode,ynode);

    int i,j;

    for(i=0; i<xnode; i++)
    {
	for(j=0; j<ynode; j++)
	{
	    x[i][j] = xlow + i*deltax;
	    y[i][j] = ylow + j*deltay;
	}
    }

    double term1, term2, term3;

    double phi;
    for(i=0; i<xnode; i++)
    {
	for(j=0; j<ynode; j++)
	{
	    printf("%d %d\n",i,j);
	    printf("%.6f %.6f\n",x[i][j],y[i][j]);
	    printf("Computing phi\n");
	    phi = getphi(x[i][j],y[i][j],t);	    
	    printf("phi: %.6e\n",phi);
	    
	    printf("Computing 1\n");
	    term1 = getterm1(x[i][j],y[i][j],t);
	    printf("term1: %.6e\n",term1);
	    
	    printf("Computing 2\n");
	    term2 = getterm2(x[i][j],y[i][j],t);
	    printf("term2: %.6e\n",term2);
	    
	    printf("Computing 3\n");
	    term3 = getterm3(x[i][j],y[i][j],t);
	    printf("term3: %.6e\n\n",term3);   
	    
	}
    }
    
}
